import React, {FC} from 'react';

export interface TicTacItemProps {
    onClick?: () => void,
    width?: string,
    height?: string
    onMouseEnterFunc?: () => void
}

const TicTacItem: FC<TicTacItemProps> = (
    {
        onClick,
        width = '300px',
        height = '300px',
        onMouseEnterFunc
    }) => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                width: '200px',
                height: '200px',
                top: '0',
                left: '0',
                position: 'fixed',
                border:'1px solid red'
            }}
            onClick={onClick}
            onMouseEnter={onMouseEnterFunc}
            style={{width, height, border: '2px solid black', display: 'flex'}}
        >
        </div>
    );

};

export default TicTacItem;
